  name: TFOutput
  nameWithType: TFOutput
  fullName: TensorFlow.TFOutput
  type: Struct
  assemblies:
  - TensorFlowSharp
  namespace: TensorFlow
  summary: Represents a specific output of an operation on a tensor.
  remarks: "<p>\n            TFOutput objects represent one of the outputs of an operation in the graph\n            (TFGraph).  Outputs have a data type, and eventually a shape that you can \n            retrieve by calling the <xref href=\"TensorFlow.TFGraph.GetShape\"></xref> method.\n            </p>\n    <p>\n            These can be passed as an input argument to a function for adding operations \n            to a graph, or to the TFSession's Run and GetRunner method as values to be\n            fetched.\n            </p>"
  syntax:
    content: public struct TFOutput
  inheritance:
  - System.ValueType
  implements: []
